import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const UserDashboard = () => {
  return (
    <div className="container mt-5">
      <h1>User Dashboard</h1>
      <p>View and manage your events and photos.</p>
    </div>
  );
};

export default UserDashboard;
